import React, { useState } from "react";
import {Product} from "./product";
import productData from "./productData";


export const Body = () =>{
    const productModal = productData.map(
        item => {
            return (

                <Product
                    key = {item.id}
                    list = {item}
                />

            )
        }
    )

    const [added, setAdded] = useState("true")
    const Page = () =>{
        setAdded((element) => element = !element)
        console.log(setAdded())
    }
    return (
        <div className="body">
            <div className="add" onClick={Page}>新增产品</div>
            {productModal}
        </div>
    )
}
